import React from 'react';
import './Banner.css';

function Banner() {
  return (
    <section className="banner">
      <div className="banner-overlay">
        <h1 className="banner-title">Chào mừng đến với Tiệm Trà Nhà Bưởi</h1>
        <p className="banner-slogan">Khám phá hương vị trà truyền thống Việt Nam</p>
        <button className="banner-cta">Khám phá ngay</button>
      </div>
    </section>
  );
}

export default Banner;
